import json

def createNodes(antiBase_map):
	nodes_list = []
	group = 1
	for key in antiBase_map.keys():
		temp_node = {}
		temp_node["id"] = key 
		temp_node["group"] = group
		nodes_list.append(temp_node)
		for i in range(0, len(antiBase_map[key][1])):
			temp_node = {}
			temp_node["id"] = str(antiBase_map[key][1][i]) +" " +str(antiBase_map[key][0][i])
			temp_node["group"] = group
			nodes_list.append(temp_node)
		group += 1
	return nodes_list

